import Dashboard from "./dashboard";
//import Auth from "./auth";
import { Routes, Route } from "react-router-dom";
import NavBar from "./navbar";
export default function App() {
  return (
    <div id="main">
      <NavBar />
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <Dashboard />
            </div>
          }
        ></Route>
      </Routes>
    </div>
  );
}
